// jscs:disable disallowEmptyBlocks
//noinspection BadExpressionStatementJS
'format es6';

import 'angular';
import 'angular-mocks';
import Service from './movie-service';

describe( 'MovieService', () => {
  let service;
  //jscs:disable
  const defaultImage = 'data:image/png;base64,'; // jshint ignore:line
  //jscs:enable

  it( 'should provide a default movie image', () => {
    service = new Service();

    expect( service.getDefaultImage() ).to.equal( defaultImage, 'must' +
      ' provide' +
      ' default movie image' );
  });
});
